import PropTypes from "prop-types";

function Button({text, bgColor}) {
    return <button style={{
        color: "white",
        backgroundColor: "tomato",
    }}>{text}</button>
}

Button.propTypes = {
    text: PropTypes.string.isRequired,
}

export default Button;
